import React, { useState, useEffect } from "react";
import Container from "react-bootstrap/Container";
import Nav from "react-bootstrap/Nav";
import Navbar from "react-bootstrap/Navbar";
import { NavLink } from "react-router-dom";
import Button from "react-bootstrap/Button";
import axios from "axios";
import { useContext } from "react";
import { Appcontext } from "../App";
import ReadbyDoctorId from "./Questions/MydoctorQns";
import ReadbyPatientId from "./Questions/MypatientQns"

function StackExchangeHome() {
  const [tags, setTags] = useState([]);
  const { user } = useContext(Appcontext);

  useEffect(() => {
    const fetchSavedRecipes = async () => {
      try {
        const response = await axios.get(
          `http://localhost:5000/stackExchange/`
        );
        setTags(response.data);
      } catch (err) {
        console.log(err);
      }
    };

    fetchSavedRecipes();
  }, []);

  // Use the map function to iterate over the data and create components
  const components = tags.map((item) => (
    <NavLink to="/renderbyTags/{item.tagid}" key={item.tagid}>
      <Button variant="dark" size="lg" style={{ fontFamily: "sans-serif" }}>
        {item.tagid}
      </Button>
    </NavLink>
  ));
  return (
    <>
      {[false].map((expand) => (
        <Navbar key={expand} expand={expand} className="bg-body-tertiary">
          <Container fluid>
            <NavLink to="/MyProfile">
              <Button
                variant="secondary"
                size="lg"
                style={{ fontFamily: "sans-serif" }}
              >
                Ask
              </Button>
            </NavLink>
            <NavLink to="/MyProfile">
              <Button
                variant="secondary"
                size="lg"
                style={{ fontFamily: "sans-serif" }}
              >
                Search/readbyTags
              </Button>
            </NavLink>
            <Navbar.Brand
              href="#"
              style={{
                fontSize: "27px",
                fontWeight: "bold",
                textDecoration: "underline",
                fontFamily: "sans-serif",
              }}
            >
              StackExchange for Health and Medicine-
            </Navbar.Brand>
            <Navbar.Toggle aria-controls={`offcanvasNavbar-expand-${expand}`} />
          </Container>
        </Navbar>
      ))}
      {user === "doctor" ? (
      <ReadbyDoctorId/>
      ) : (
       <ReadbyPatientId/>
      )}
    </>
  );
}

export default StackExchangeHome;
